query Proposals {
  _meta {
    block {
      number
      timestamp
    }
  }
  proposals(orderBy: createdTimestamp, orderDirection: desc, first: 1000) {
    id
    createdTimestamp
    startBlock
    endBlock
    executionETA
    title
    status
    proposer {
      id
    }
    forVotes
    abstainVotes
    againstVotes
    quorumVotes
    totalSupply
    minQuorumVotesBPS
    maxQuorumVotesBPS
    quorumCoefficient
  }
}

